import React from "react"

const EmptyThreadInfoBox = (props) => {
	// the container div should have the contents inside stack vertically
	return (
		<div className="text-gray-800 w-full md:max-w-2xl lg:max-w-3xl md:h-full md:flex md:flex-col px-6 dark:text-gray-100 bg-white rounded-lg">
			<div className="flex gap-3 items-center m-auto text-lg font-bold md:flex-col md:gap-2">
				{props.title}
			</div>
			<ul className="flex flex-col gap-3.5 w-full sm:max-w-md m-auto">
				<li className="w-full text-stone-700 p-2 rounded-md">
					{props.text1}
				</li>
				<li className="w-full text-stone-700 p-2 rounded-md">
					{props.text2}
				</li>
				<li className="w-full text-stone-700 p-2 rounded-md">
					{props.text3}
				</li>
			</ul>
			{/* add the very bottom of the container, add a purple background */}
			<div className="flex flex-col gap-3.5 w-full sm:max-w-md m-auto bg-red"></div>
		</div>
	)
}

export default EmptyThreadInfoBox
